/**
 * @file
 * Responsive table scripts.
 *
 * @type {Drupal~behavior}
 */

(function($, Drupal) {
  'use strict';
  Drupal.behaviors.responsiveTable = {
    attach: function(context, settings) {
      $(window).on('load', function() {
        $('table td').on('mouseover', function () {
          $(this).closest('tr').addClass('highlight');
          $(this).closest('table').find('td:nth-child(' + ($(this).index() + 1) + ')').addClass('active-column');
          $(this).addClass('active-cell');
        });
        $('table td').on('mouseout', function () {
          $(this).closest('tr').removeClass('highlight');
          $(this).closest('table').find('td:nth-child(' + ($(this).index() + 1) + ')').removeClass('active-column');
          $(this).removeClass('active-cell');
        });
      });
    },
  };
})(jQuery, Drupal);
